import React from "react"; 
import '../Styles/PersonalData.css'
import Name from "./Name";
import profile from '../Assets/profile.png'

const PersonalData = () => {
    return(
        <div className="personal-data-container">
            <img src={profile}></img>
            <Name/>
        </div>
    )
}

export default PersonalData;
